export class BaseBusinessColumn {
  name = '';
  constructor(fileds) {
    this.name = fileds.name;
  }
}

export class TextColumn extends BaseBusinessColumn {
  age = 0;
  sex = '男';
  constructor(fileds) {
    super(fileds);
    this.age = fileds.age;
    this.sex = fileds.sex;
  }
}

export let testTextColumn = new TextColumn({ name: '111', age: 12, sex: '女' });
export let testBaseBusinessColumn = new BaseBusinessColumn({ name: '111' });
